  false,\n\t\"url\": null,\n\t\"notes\": \"The Watershed Boundary Dataset (WBD) is
  a complete digital hydrologic unit national boundary layer that is at the Subwatershed
  (12-digit) level. It is composed of the watershed boundaries delineated by state
  agencies at the 1:24,000 scale. Please refer to the individual state metadata as
  the primary reference source. To access state specific metadata, go to the following
  link to view documentation created by agencies that performed the watershed delineation.
  This data set is a complete digital hydrologic unit boundary layer to the Subwatershed
  (12-digit) 6th level. This data set consists of geo-referenced digital data and
  associated attributes created in accordance with the \"FGDC Proposal, Version 1.0
  - Federal Standards For Delineation of Hydrologic Unit Boundaries 3/01/02\". Polygons
  are attributed with hydrologic unit codes for 4th level sub-basins, 5th level watersheds,
  6th level subwatersheds, name, size, downstream hydrologic unit, type of watershed,
  non-contributing areas and flow modification. Arcs are attributed with the highest
  hydrologic unit code for each watershed, linesource and a metadata reference file.Please
  refer to the Metadata contact if you want access to the WBD national data set.\",\n\t\"license_title\":
